import React, { useEffect } from 'react';

import '../pages/BannerB.scss';
import MainBannerPrimary from '../components/bannerb/MainBannerPrimary';

function BannerB() {

  useEffect(() => {
      document.title = 'Template - Banner B';
  })

  return (
    <>
      <MainBannerPrimary />
    </>
  );
}

export default BannerB;
